column74:
APOYO LOGISTICO PARA EL ENCUENTRO ENTRE LA ADMINISTRACIÓN MUNICIPAL Y LA COMUNIDAD EN GENERAL CON DOS COMISIONES MINISTERIALES PARA LOS SIGUIENTES ASUNTOS: A). CONECTIVIDAD;
COMPUTADORES PARA EDUCAR Y LABORATORIOS DE INNOVACIÓN CON  EL MINISTRO DE LAS TECNOLOGIAS DE LA INFORMACIÓN Y LAS COMUNICACIONES; Y B). LA PRIMERA EDICIÓN DE LOS MERCADOS
JUVENILES CON EL MINISTERIO DE AGRICULTURA Y DESARROLLO RURAL; CADA UNO CON SUS RESPECTIVAS DELEGACIONES.
